/*Table structure for table `factura` */

DROP TABLE IF EXISTS `factura`;

CREATE TABLE `factura` (
  `num_factura` int(11) NOT NULL AUTO_INCREMENT,
  `id_cliente` decimal(10,0) DEFAULT NULL,
  `nom_cliente` varchar(100) DEFAULT NULL,
  `id_usuario` decimal(10,0) NOT NULL,
  `fecha` datetime NOT NULL,
  `pendiente` tinyint(1) NOT NULL DEFAULT '0',
  `mesa` int(11) NOT NULL,
  `totalRecibido` int(11) DEFAULT '0',
  `total` int(11) DEFAULT '0',
  PRIMARY KEY (`num_factura`),
  KEY `id_cliente` (`id_cliente`),
  KEY `id_usuario` (`id_usuario`),
  CONSTRAINT `factura_ibfk_2` FOREIGN KEY (`id_usuario`) REFERENCES `usuarios` (`Cedula`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=42 DEFAULT CHARSET=utf8;

